import React from "react";
import logo from '../logo.svg';
import '../App.css';
import Navbar from "./navbar";
import MiddleText from "./middleContainer";
import CopyrightsText from "./copyrights";
import Scripts from "./bottomContainer";

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <div className="App">
     <Navbar></Navbar>
     <MiddleText></MiddleText>
     <CopyrightsText></CopyrightsText>
     <Scripts></Scripts>
    </div>
  );
}

export default App;
